data_dir_training = '/content/Training'
data_dir_testing = '/content/Testing'

##TRY TO OVERFIT###

# TODO: Define transforms for the training data and testing data
# For training we perform Data Augmentation (introduce randomness in the input data itself)
train_transforms = transforms.Compose([transforms.RandomRotation(30), 
                                       transforms.RandomResizedCrop(224), #crops 224x224 from the center (check if it is actually resizing)
                                       transforms.RandomHorizontalFlip(), #mirror the image
                                       transforms.ToTensor(),
                                       transforms.Normalize([0.485, 0.456, 0.406],
                                                            [0.229, 0.224, 0.225])])

# For testing we want to use images that aren't altered other than normalizing. 
# So, for validation/test images, you'll typically just resize and crop.
test_transforms = transforms.Compose([transforms.Resize(224), 
                                      transforms.ToTensor(),
                                      transforms.Normalize([0.485, 0.456, 0.406],  
                                                           [0.229, 0.224, 0.225])])

# Pass transforms in here
train_data = datasets.ImageFolder(data_dir_training, transform=train_transforms)
test_data = datasets.ImageFolder(data_dir_testing, transform=test_transforms)

# percentage of training set to use as validation
valid_size = 0.3
batch_size = 64

# obtain test indices that will be used for validation
num_test = len(test_data)
indices = list(range(num_test))
np.random.shuffle(indices)
split = int(np.floor(valid_size * num_test))
test_idx, valid_idx = indices[split:], indices[:split]

# define samplers for obtaining training and validation batches
test_sampler = SubsetRandomSampler(test_idx)
valid_sampler = SubsetRandomSampler(valid_idx)

trainloader = torch.utils.data.DataLoader(train_data, batch_size=batch_size)
validloader = torch.utils.data.DataLoader(train_data, batch_size=batch_size, sampler=valid_sampler)
testloader = torch.utils.data.DataLoader(test_data, batch_size=batch_size, sampler=test_sampler)


