# ### **Loading Densenet and Replacing the Classifier**

# We can load in a model such as DenseNet (with 121 hidden layers). This pre-trained neural network can transfer the pattern recognition from ImageNet dataset (features) and only train a new classifier. Let's print out the model architecture so we can see what's going on.

# In[ ]:


model = models.densenet121(pretrained=True) # 121 hidden layers
#model


# This model is built out of two main parts, the features and the classifier. The features part is a stack of convolutional layers and overall works as a feature detector that can be fed into a classifier. The classifier part is a single fully-connected layer (classifier): Linear(in_features=1024, out_features=1000). This layer was trained on the ImageNet dataset, so it won't work for our specific problem. That means we need to replace the classifier, but the features will work perfectly on their own. In general, I think about pre-trained networks as amazingly good feature detectors that can be used as the input for simple feed-forward classifiers.

# With our model built, we need to train the classifier. However, now we're using a really deep neural network. If you try to train this on a CPU like normal, it will take a long, long time. Instead, we're going to use the GPU to do the calculations. The linear algebra computations are done in parallel on the GPU leading to 100x increased training speeds. It's also possible to train on multiple GPUs, further decreasing training time.
# 
# __PyTorch, along with pretty much every other deep learning framework, uses CUDA to efficiently compute the forward and backwards passes on the GPU.__ In PyTorch, you move your model parameters and other tensors to the GPU memory using __model.to('cuda')__. You can move them back from the GPU with model.to('cpu') which you'll commonly do when you need to operate on the network output outside of PyTorch. As a demonstration of the increased speed, I'll compare how long it takes to perform a forward and backward pass with and without a GPU.

# In[ ]:


# Use GPU if it's available
device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

# Freeze parameters so we don't backprop through them. 
# If requires_grad = True then PyTorch keeps track of operations on a tensor and calculates the gradients
for param in model.parameters():
    param.requires_grad = False

# it is more convenient to build a model with a log-softmax output.
# With log-softmax output you want to use the negative log likehood loss.
# Dim=0, calculates softmax across the rows, so each columns sums to 1
# Dim=1, calculates softmax across the columns, so each row sums to 1.
# In this case each row is one example within the batch, so we use dim=1 to calculate the softmax across each of our examples.
model.classifier = nn.Sequential(nn.Linear(1024, 256),
                                 nn.ReLU(),
                                 nn.Dropout(0.2),
                                 nn.Linear(256, 2),
                                 nn.LogSoftmax(dim=1))

criterion = nn.NLLLoss()
# we could also do:
# criterion = nn.CrossEntropyLoss() but we need the raw output of the network into the loss, not the softmax output.
# This separates the usual criterion = nn.CrossEntropy() into two steps: softmax and NLLLoss, 
# and is a useful approach should you want the output of a model to be class probabilities rather than class scores.

# Only train the classifier parameters, feature parameters are frozen
optimizer = optim.Adam(model.classifier.parameters(), lr=0.003)

model.to(device);


# ![image.png](data:image/png;base64,)

# ### **Training the Network**

# Good theory about backprop, loss function, autograd. <br>
# 
# https://github.com/udacity/deep-learning-v2-pytorch/blob/master/intro-to-pytorch/Part%203%20-%20Training%20Neural%20Networks%20(Exercises).ipynb
# 
# More notes about epoch, batch size, iterations <br>
# https://towardsdatascience.com/epoch-vs-iterations-vs-batch-size-4dfb9c7ce9c9

# In[ ]:


epochs = 5
train_losses, valid_losses = [], []
valid_loss_min = np.Inf # set initial "min" to infinity

for epoch in range(epochs):
  # monitor training loss
  train_loss = 0.0
  valid_loss = 0.0

  for inputs, labels in trainloader:
    # Move input and label tensors to the default device
    inputs, labels = inputs.to(device), labels.to(device)
    
    # clear the gradients
    optimizer.zero_grad()
    
    logps = model(inputs) # make a forward pass through the network and returns the predicted scores for each class output
    loss = criterion(logps, labels) # use the network output to calculate the loss
    loss.backward() # perform backward pass through the network to calculate the gradients
    optimizer.step() # take a step with the optimizer to update the weights 

    train_loss += loss.item() #loss.item() is the averaged loss over the batch
  else:
    test_loss = 0
    accuracy = 0

    # During training we want to use dropout to prevent overfitting, but during inference we want to use the entire network. 
    # To do this, use model.eval(). This sets the model to evaluation mode where the dropout probability is 0.
    model.eval()
    with torch.no_grad():
      for inputs, labels in validloader:
          inputs, labels = inputs.to(device), labels.to(device)
          logps = model(inputs)
          batch_loss = criterion(logps, labels)
          
          valid_loss += batch_loss.item()
          
          # Calculate accuracy
          # dim=1 takes the sum accross the columns for each row
          # topk(1) returns a tuple of tensors, the first one with the top-1 probability values and the top-1 indices
          # top_class is a 2D tensor with shape (64, 1) while labels is 1D with shape (64), so we reshape 
          # 'equals' has binary values, 1 if the prediction matches the actual label and 0 otherwise
          ps = torch.exp(logps)
          top_p, top_class = ps.topk(1, dim=1)
          #print(ps.topk(1, dim=1))
          #print(top_class)
          #print(labels)
          #break 
          equals = top_class == labels.view(*top_class.shape)
          accuracy += torch.mean(equals.type(torch.FloatTensor)).item()
    #break       
    # collect training and testing losses
    train_losses.append(train_loss/len(trainloader))
    valid_losses.append(valid_loss/len(validloader))

    # save model if validation loss has decreased
    if valid_loss <= valid_loss_min:
      print('Validation loss decreased ({:.6f} --> {:.6f}).  Saving model ...'.format(
      valid_loss_min/len(validloader),
      valid_loss/len(validloader)))
      torch.save(model.state_dict(), 'model.pt')
      valid_loss_min = valid_loss
    else:
      print('Validation loss did not decrease')

    # turn dropout back on by setting the model to train mode with model.train()
    model.train()
  print(f"Epoch {epoch+1}/{epochs}.. "
      f"Train loss: {train_loss/len(trainloader):.3f}.. "
      f"Valid loss: {valid_loss/len(validloader):.3f}.. "
      f"Valid accuracy: {accuracy/len(validloader):.3f}")


